import React, { useEffect } from 'react';


export default function Popup(props) {
    let [shouldOpenMyDiv] = this.useState(false);
    useEffect(() => {
        shouldOpenMyDiv = props.shouldOpenMyDiv;
    }, [props.shouldOpenMyDiv])

    return (
        <button className="" onClick={shouldOpenMyDiv}>
            Hi
        </button>
    );
}
